import {NavLink} from 'react-router-dom';
import styles from './Header.module.css';
const Header = () => {
    return <header className={styles["main-header"]}>
                <div className={styles.brand}>CRM</div>
                <nav className={styles.navigation}>
                    <ul className={styles.items}>
                        <li className={styles.item}><NavLink activeClassName={styles.active}  to="/home">Home</NavLink></li>
                        <li className={styles.item}><NavLink  to="/leads">Leads</NavLink></li>
                        <li className={styles.item}><NavLink to="/contacts">Contacts</NavLink></li>
                    </ul>
                </nav>
            </header>
}

export default Header;
